import { Link } from 'react-router-dom';
import './App.css';
import {Button, Stack, Typography} from '@mui/material';

import Nav from './components/Nav/Nav';
import { Box, Container } from '@mui/system';

function App() {
  return (
    // <Routes>
    <div className="App">
      <Container sx={{border: '1px solid red', display: 'column', justifyContent: 'center', alignItems: 'center'}}>
        <Box>
      <Typography variant='h3'>Hello From App</Typography>
      </Box>
      <Stack direction='row' spacing={2}>
      <Button variant='contained' href='/navbar'>Navbar</Button>
      <Button variant='outlined' href='/navbar'>Expenses</Button>
      </Stack>
      </Container>
      {/* <Link to={'/navbar'}>Navbar</Link>
      <Link to={'/expense'}>Expense</Link> */}
      {/* <Route path='/navbar' component={<Nav />} /> */}
      {/* <Nav /> */}
    </div>
    // </Routes>
  );
}

export default App;
